fun p14() {
    var maxNumber = 0L
    var maxCount = 0
    var number = 0L
    var count = 0

    for (i in 1..1000000) {
        number = i
        count = 1
        while (number != 1) {
            if (number % 2 == 0) {
                number /= 2
            } else {
                number = 3 * number + 1
            }
            count++
        }
        if (count > maxCount) {
            maxNumber = number
            maxCount = count
        }
    }

    println("A14: $maxNumber ($maxCount)")
}
